import React from 'react';
import Container from 'react-bootstrap/Container';
import styled from 'styled-components';
const Styles = styled.div`
    list: {
        width: 500px;
    }
`;

export const Layout = (props) => (
    <Styles>
        <Container className="list">
            {props.children}
        </Container>
    </Styles>
)
